import React from 'react';
import notes from '../assets/data';


function NotesListPage() {
  return (
    <div>
        <ul>
            {notes.map((note) => {
                return (
                    <li key={note.id}>note.body</li>
                );
            })}
        </ul>
    </div>
  )
}

export default NotesListPage
